import React from 'react';
import { useNavigate } from 'react-router-dom';

function Login()
{
    const navigate = useNavigate();

    const navigateHome = () => 
    {
        navigate('/home');
    }

    const doLogin = async event => 
    {
        event.preventDefault();

        alert('Logging in!!');
        navigateHome();
    };


    return(
      <div class="box">
        <div id="loginDiv" class ="BoxContainer">
            <form class ="FormContainer" onSubmit={doLogin}>
            <span id="inner-title"><h1>GAINZ<span class="textLogo">BOY</span></h1></span><br />
            <input type="text" id="loginName" placeholder="Username" /><br />
            <input type="password" id="loginPassword" placeholder="Password" /><br />
            <input type="submit" id="loginButton" class="loginButton" value = "Log In"
            onClick={doLogin} />
            </form>
            <a href="/signUp" class="NewAccount">Create an Account</a>
            <span id="loginResult"></span>
        </div>
    </div>  
      
    );
};

export default Login;
